    alert(presentacion)
    return ( <
        div className = "App" >
        <
        header className = "App-header" >
        <img src = { logo }
        className = "App-logo"
        alt = "logo"/>
        {presentacion}
        <p>
        BIENVENIDOS {presentacion}
        </p> <a className = "App-link"
        href = "https://reactjs.org"
        target = "_blank"
        rel = "noopener noreferrer" >
